import React from 'react';
import "./Popup.css";
import fileloader from "../Assets/Pics/Fileloader.svg";
import canel from "../Assets/Pics/cancel 1.svg"
const Popup = ({ onClose }) => {
  return (
    <div className="popup-container">
      <div className="popup-content">
       <div>
       <img src={fileloader} alt="file loader" />
       <img src={canel} alt="cancel" onClick={onClose} className="top-4 right-4 cursor-pointer" />
       </div>
        <h2>Required Documents List</h2>
        <ul>
          <li>Document 1</li>
          <li>Document 2</li>
          <li>Document 3</li>
        </ul>
        <button style={{width:"300px"}} onClick={onClose} className="mt-8 bg-red-500 text-white py-2 px-4 rounded">Continue</button>

      </div>
    </div>
  );
};

export default Popup;
